def velocity(pos):
    vel = []
    for i in range(0, len(pos)-1):
        tmp = (pos[i+1]-pos[i])/dt
        vel.append(tmp)
    vel.append(0)
    return vel  

def interpolate(y1, x1):
    y = []
    x = 0.0
    i = 1
    while x < x1[-1]:
        y.append(y1[i-1] + (x - x1[i-1])*(y1[i]-y1[i-1])/(x1[i]-x1[i-1]))
        x += 5/1000
        if x >= x1[i]:
            i += 1
    y.append(y1[len(y1)-1])
    return y

